import React from 'react';
// import { formatDate } from '../../../Tools';

const SingleReceipt = ({ type, date, payeeName, amount, status } ) => {
   // date = formatDate(date, 'dd/MM/yyyy HH:mm');

   return (
      <section className="module single-transfer">
         <h1>{type}</h1>
         <ul>
            <li>Date: {date}</li>
            <li>Payee: {payeeName}</li>
            <li>Amount: {amount}</li>
            <li>Type: {type}</li>
            <li>Status: {status}</li>
         </ul>
      </section>
   );
};



export default SingleReceipt;
